import React from 'react';
import { Container, Typography, Box } from '@mui/material';

function FAQ() {
  return (
    <Container maxWidth="md" sx={{ paddingY: 5 }}>
      <Typography variant="h4" sx={{ color: '#132a47', textAlign: 'center', fontWeight: 'bold', marginBottom: 4 }}>
        Frequently Asked Questions
      </Typography>
      <Box>
        <Typography variant="h6" sx={{ color: '#132a47', fontWeight: 'bold' }}>
          How do I sign up for a tournament?
        </Typography>
        <Typography variant="body1" sx={{ color: '#4a4a4a', marginBottom: 3 }}>
          Simply click the "Sign Up" button on the homepage, create an account, and choose a tournament from the list.
        </Typography>
        {/* Add more FAQs similarly */}
      </Box>
    </Container>
  );
}

export default FAQ;
